import "./App.css";
import HeaderComponent from "./components/header/Header.tsx";
import { ButtonComponent } from "./components/buttonComponent/button.tsx";
import { FoodContainer } from "./components/foodcontainer/foodContainer.tsx";
import outbackImage from "./components/imgs/restaurants/outback.webp";

function App() {
  return (
    <div className="App">
      <HeaderComponent></HeaderComponent>
      <br></br>

      <div className="foodDisplayer">
        <FoodContainer img={<img src={outbackImage} alt="Imagem" />} />
        <FoodContainer img={<img src={outbackImage} alt="Imagem" />} />
        <FoodContainer img={<img src={outbackImage} alt="Imagem" />} />
      </div>
    </div>
  );
}

export default App;
